import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer'
import '../styles/sellerStoreList.css'

import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar';

function StoreEntry() {
  return (
    <div className="StoreEntry flexCenter rowFlex">
      <Avatar sx={{ flex: 1, bgcolor: 'blue' }}>YS</Avatar>
      <div style={{ flex: 3 }}>
        <h1>StoreName</h1>
        <div className="StoreEntryDetailRow">
          <p>3 Active Listings</p>
          <p>|</p>
          <p>2 Pending Items</p>
        </div>
      </div>
      <div style={{ flex: 1 }}>
        <Button>Edit</Button>
        <Button>Delete</Button>
      </div>
    </div>
  );
}

export default function SellerStoreList() {
  return (
    <>
      <Header />
      <div className="flexCenter colFlex">
        <div className="storeListSubHeader">
          <h1>Your Stores</h1>
          <Button color="primary" variant="contained" size="medium">New Store</Button>
        </div>
        <div className="storeListContainer">
          <StoreEntry />
        </div>
      </div>
      <Footer />
    </>
  );
}
